class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        best = 0
        current = ""
        for c in s:
            if c in current:
                i = current.index(c)
                if len(current)>best:
                    best = len(current)
                current = current[i+1:]+c
            else:
                current+=c
        if len(current)>best:
            best = len(current)
        return best

